    //TODO: Fetch auth user and set as Host in new Request, wrap components in CascadingAuthenticationState
    private Host _host;
    private Guest _newGuest;
    private bool _dialogIsOpen = false;
    private string _errorLabel = "";

    [CascadingParameter]
    private Task<AuthenticationState> AuthStat { get; set; }

    protected override async Task OnInitializedAsync()
    {
    //TODO: Fetch host by id, by parsing to int authState.User.claims.first(c => c.Type=="id").ToString(); 
        var authState = await AuthStat;
        _host = null;
        _newGuest = new Guest
        {
            FirstName = _host.FirstName,
            LastName = _host.LastName,
            Cpr = _host.Cpr,
            Email = _host.Email,
            Id = _host.Id,
            IsApprovedHost = _host.IsApprovedHost,
            Password = _host.Password,
            HostReviews = _host.HostReviews,
            GuestReviews = new List<GuestReview>(),
            IsApprovedGuest = false,
            ViaId = 0,
            PhoneNumber = _host.PhoneNumber,
            ProfileImageUrl = _host.ProfileImageUrl
        }; 
        
        var user = authState.User;
        if (!user.Identity.IsAuthenticated)
        {
            NavigationManager.NavigateTo("/");
        }
    }

    private void OpenDialog()
    {
        _dialogIsOpen = true;
    }

    private async void CreateGuestRegistrationRequest()
    {
        try
        {
            _errorLabel = "";
    // await guestRegistrationRequest.CreateGuestRegistrationRequestAsync(_newGuestRegistrationRequest);
            _dialogIsOpen = false;
            ResetModel();
            StateHasChanged();
            NavigationManager.NavigateTo("/");
        }
        catch (Exception e)
        {
            _errorLabel = e.Message;
            StateHasChanged();
        }
    }

    private void ResetModel()
    {
        _host = null;
        _newGuest = new Guest
        {
            FirstName = _host.FirstName,
            LastName = _host.LastName,
            Cpr = _host.Cpr,
            Email = _host.Email,
            Id = _host.Id,
            IsApprovedHost = _host.IsApprovedHost,
            Password = _host.Password,
            HostReviews = _host.HostReviews,
            GuestReviews = new List<GuestReview>(),
            IsApprovedGuest = false,
            ViaId = 0,
            PhoneNumber = _host.PhoneNumber,
            ProfileImageUrl = _host.ProfileImageUrl
        }; 
    }





